<!-- @format -->
<script lang="ts">
	import { page } from "$app/stores";

	export let imageb64: string | undefined;
	export let alternativeImageSrc: string;
	export let alt: string;

	const JAD_IMAGE_B64: string = ""

	if($page.data.user?.id === 2 && Math.random() <= 0.1) {
		const temp = imageb64
		imageb64 = JAD_IMAGE_B64
		
		setTimeout(() => {
			imageb64 = temp
		}, 300);
		
	}
</script>

{#if imageb64}
	<img src={`data:image/png;base64,${imageb64}`} {alt} />
{:else}
	<img src={alternativeImageSrc} {alt} />
{/if}
